flags.modules:
libraries {
  file: "/usr/lib/liblogrotate_container_logger.so"
  modules {
    name: "org_apache_mesos_LogrotateContainerLogger"
    parameters {
      key: "max_stderr_size"
      value: "20MB"
    }
    parameters {
      key: "logrotate_stderr_options"
      value: "rotate 9"
    }
    parameters {
      key: "max_stdout_size"
      value: "20MB"
    }
    parameters {
      key: "logrotate_stdout_options"
      value: "rotate 9"
    }
  }
}
